<script>
function getTotal(){
    		
      			num1 = document.getElementById("cCharges").value;
      			num2 = document.getElementById("sCharges").value;
      			num3 = document.getElementById("sessions").value;
      			cTotal = num1 * 1;
			sTotal = num2 * num3;
			tTotal = cTotal + sTotal;
		   	return tTotal
}
</script>

<script>
function MULTIPLY(price, shipping) {
    return price*shipping;
}
</script>

<script>
function ADDITION(price, shipping) {
    return +price + +shipping;
}
</script>

<script>
function MTH() {
const d = new Date();
let month = d.getMonth();
return month + 1
}
</script>

<script>
function YR() {
const d = new Date();
let year = d.getFullYear();
return year - 2000
}
</script>
